  false,\n\t\"url\": null,\n\t\"notes\": \"9/28/15 - The following cites have had
  annexation: Stanley, Bottineau, Minot, Casselton, Belfield and Watford City.nn7/24/15
  - Updated Grafton, Stanley, Bismarck, Williston, Horace, Fargo, Grand Forks, Watford
  City, Turtle Lake, Leeds, Maxbass and Medorann1/16/15 - Updated Grafton, Stanley
  and Bismarck.nn11/3/2014 - Updated Bismarck, Mandan, Minot, Stanley, and Watford
  Citynn7/16/14 - Corporate limits updated include: Mandan, Towner, Fargo, West Fargo,
  Grand Forks, Bismarck, Bowman, Watford City, Stanley, Tioga, Kenmare, Casselton,
  Minot, Carrington, Kindred, and Killdeer. The corporate limit updates consisted
  of receiving from the cities, shape files, CADD files, scanned images of annexations
  or by converting pdf files into images, rectifying them within ArcGIS, then heads-up
  digitizing. nn7/29/13 - updated Stanley, Williston, Minot, and Bismarcknn4/30/13
  - updated Williston, Hazen, Minot, Dickinson, Valley City, Velva, Rugby, Bismarck,
  and Lincolnnn1/28/13 - updated Valley City, Grand Forks, Bismarck, Williston, Jamestown,
  Harvey, Mohall, Park River, Ray, Rugby, Stanley, Tioga, Mayville and Glenfieldnn10/9/12
  - updated Williston and Dickinsonnn6/20/12 - updated Williston via shapefile from
  citynn3/20/12 - updated Bismarck and Minotnn10/3/2011 - Edited corporate limits
  for Bottineau, Grand Forks, Bismarck, Grafton, Fargo, West Fargo, Horace, Dickinson,
  Williston, Valley City and Devils Lake.nn2/4/11 - Removed urban areas so only corporate
  boundaries remain.  Removed boolean field named URBAN_AREA.  Updated corporate limist
  in Dickinson and cities with Cass county.nn6/24/10 - Stanley, Lincoln, Oakes, Hankinson,
  Enderlin, Ellendale, Linton, Carrington, Minot, and Kulm corportate limits were
  changednn6/18/09 - Stanley, Wahpeton, Center, Watford City, Williston, Grand Forks,
  Killdeer, Beulah, Beach, Hazen, Garrison, Washburn, Bismarck and Lincoln corporate
  limits were changednn3/24/08 - Added Milton, Drayton, and Cavalier Boudaries updated:
  Park River nn1/16/08 - Boundaries updated: Devils Lake, Glen Ullin, Langdon, Minnewaukan,
  Northwood, Thompson nn2/13/07 - Boundaries updated: Amenia, Arthur, Bismarck, Bottineau,
  Buffalo, Casstleton, Davenport, Dickinson, Enderlin, Gardner, Grand Forks, Grandin,
