  New Rockford, Oxbox, Page, Prairie Rose, Relies Acres, Tappen, Towner City nn1/10/06
  - Boundaries updated: Wishek, Fargo, Lincoln, Bottineau, Williston, Grand Forks,
  Granville, Velva, Stanley, urban areas in Fargo, West Fargo, Bismarck and Mandan.
